import React from 'react';
import { About, Brand, Navbar } from './components';
import { Footer, Features, Blog, Possibility, Header, WhatGPT3 } from './containers';
import './App.css';


const App = () => {
  return (
    <div className='App'>
      <Navbar />
      <About />
      <Brand />
      <WhatGPT3 />
      <Features />
      <Possibility />
      <CTA />
      <Blog />
      <Footer />
    </div>
  )
}

export default App
